import React from 'react';

const ContactUs = () => {
  return (
    <div className="contact-us">
      <form action="#" method="post">
        {/* Name Field */}
        <label htmlFor="customerName">
          NAME <em>*</em>
        </label>
        <input type="text" id="customerName" name="customerName" required />

        {/* Email Field */}
        <label htmlFor="customerEmail">
          EMAIL <em>*</em>
        </label>
        <input type="email" id="customerEmail" name="customerEmail" required />

        {/* Phone Number Field */}
        <label htmlFor="customerPhone">
          PHONE
        </label>
        <input
          type="tel"
          id="customerPhone"
          name="customerPhone"
          pattern="[0-9]{3}-[0-9]{3}-[0-9]{4}"
          placeholder="123-456-7890"
        />

        {/* Order Number Field */}
        <label htmlFor="orderNumber">
          ORDER NUMBER
        </label>
        <input type="text" id="orderNumber" name="orderNumber" />

        {/* Message Field */}
        <label htmlFor="customerNote">
          YOUR MESSAGE <em>*</em>
        </label>
        <textarea rows="4" id="customerNote" name="customerNote" required />

        {/* Additional Information */}
        <h3>Please provide all the information about your issue you can.</h3>

        {/* Spam Protection Field */}
        <label htmlFor="spamProtection">
          SPAM PROTECTION <em>*</em>
          <span> &nbsp;&nbsp;&nbsp;&nbsp;What day comes before July 11th?</span>
        </label>
        <input type="text" id="spamProtection" name="spamProtection" />

        {/* Submit Button */}
        <button type="submit" id="customerOrder">SUBMIT</button>
      </form>
    </div>
  );
};

export default ContactUs;
